import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion'; // Ensure Framer Motion is imported

function HeaderLinks() {
  // Variants for the dropdown container
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1, // Delay between each child animation
      },
    },
  };

  // Variants for individual dropdown items
  const itemVariants = {
    hidden: { y: -20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
    },
  };

  return (
    <div className="dropdown">
      <button className="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenuButton" data-bs-toggle="dropdown" aria-expanded="false">
        Menu
      </button>
      {/* Apply Framer Motion to animate the dropdown menu */}
      <motion.div className="dropdown-menu" aria-labelledby="dropdownMenuButton"
        variants={containerVariants}
        initial="hidden"
        animate="visible"
        exit="hidden"
      >
        {/* Wrap each Link in a motion.div and apply item variants */}
        <motion.div variants={itemVariants}>
          <Link to="/" className="dropdown-item">Home</Link>
        </motion.div>
        <motion.div variants={itemVariants}>
          <Link to="/about" className="dropdown-item">About</Link>
        </motion.div>
        <motion.div variants={itemVariants}>
          <Link to="/contact" className="dropdown-item">Contact</Link>
        </motion.div>
        <motion.div variants={itemVariants}>
          <Link to="/signup" className="dropdown-item">Sign Up</Link>
        </motion.div>
      </motion.div>
    </div>
  );
}

export default HeaderLinks;
